        <a href="#">Link 1</a>
        <a href="#">Link 2</a>
        <a href="#">Link 3</a>
        <a href="#">Link 4</a>
      </div>
      {/* Main Content */}
      <div className="main-content">
        {/* Content Goes Here */}
        <h1>Welcome to Dashboard</h1>
      </div>
    </div>
  );
};

export default Dashboard;
